INSERT INTO `worshipquestions` VALUES(8, 'What is the title of the song?', 'Single Answer', 'Sing to the Lord,Empires,Rule,We the Redeemed', 'Sing to the Lord');
INSERT INTO `worshipquestions` VALUES(9, 'Complete the following line: The heavens  _______________________', 'Single Answer', 'oh my soul,shall declare the glory of our Great God', 'shall declare the glory of our Great God');
INSERT INTO `worshipquestions` VALUES(10, 'Who is the name of the Worship Leader', 'Single Answer', 'Darlene Zschech,Marty Sampson,Reuben Morgan,Dave Ware', 'Marty Sampson');
INSERT INTO `worshipquestions` VALUES(11, 'Complete the following line: Jesus ___________', 'Single Answer', 'come let us adore Him,King let us adore Him,sing let us adore Him', 'King let us adore Him');
INSERT INTO `worshipquestions` VALUES(12, 'Complete the following line from the song titled Sing to the Lord: Holy, _____________', 'Single Answer', 'righteous our God,holy our God,sovereign our God', 'holy our God');
INSERT INTO `worshipquestions` VALUES(13, 'Complete the following line from the song titled Sing to the Lord: Sovereign__________ of all creation', 'Single Answer', 'God,Father,Ruler,Creator,Lord', 'Lord');
INSERT INTO `worshipquestions` VALUES(15, 'Complete the following line from the song of the week:\nEvery ______________', 'Single Answer', 'tribe and people,nation and people,tribe and tongue,tribe and nationality', 'tribe and tongue');
INSERT INTO `worshipquestions` VALUES(16, 'Complete the following line from the song of the week:\nLift your ____________ as one', 'Single Answer', 'heart,tongue,voice,praise', 'voice');
INSERT INTO `worshipquestions` VALUES(17, 'Complete the following line from the song of the week:\nGreat is our God ______________', 'Single Answer', 'The heavens shall declare,Great is our God,the glory of our Great God', 'Great is our God');
INSERT INTO `worshipquestions` VALUES(18, 'Complete the following line from the song of the week:\n____________ sing now and forever', 'Single Answer', 'People,Creation,Angels,Kingdom', 'Angels');
INSERT INTO `worshipquestions` VALUES(19, 'Complete the following line from the song of the week:\nThe heavens _____________ the glory of our Great God', 'Single Answer', 'will declare,has declared,shall declare,is to declare', 'shall declare');
INSERT INTO `worshipquestions` VALUES(20, 'Complete the following line from the song of the week:\nJesus ___________ let us adore Him', 'Single Answer', 'Lord,God,King,Ruler', 'King');
